import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

function Login({show,handleClose})
{
    return (
        <>
            <Modal show={show} onHide={handleClose} style={{ height:'700px' }}>
                <Modal.Header closeButton>
                    <h3>Why Sign up?</h3>
                </Modal.Header>
                
                <Modal.Body style={{ backgroundColor: '#013d62'}}>
                    <ul style={{ color:'white' }}>
                        <li>Exclusive deals</li>
                        <li>More Savings</li>
                        <li>Over 50 Stores</li>
                        <li>Over 100 Categories</li>
                    </ul>

                    <div style={{ backgroundImage: 'url(https://cdn.zoutons.com/images/common/login_bg.png)',backgroundRepeat:'no-repeat',height:'300px',backgroundColor: '#013d62'  }}>                     
                    </div>
                </Modal.Body>

                <Modal.Body>
                    Hello
                </Modal.Body>

            </Modal>
        </>
      );
}





export default Login;
